import React, { useState } from 'react';
import axios from 'axios';

const UserLogin = () => {
  const [userEmail, setUserEmail] = useState('');
  const [userPassword, setUserPassword] = useState('');

  const handleLogin = () => {
    axios.post('http://localhost:8081/customers', { userEmail, userPassword })
      .then(() => alert('User logged-in successfully!'))
      .catch((error) => console.error('Error in login user:', error));
  };

  return (
    <div className="card">
      <h2>User Login</h2>
      <input type="text" placeholder="E-mail" value={userEmail} onChange={(e) => setUserEmail(e.target.value)} />
      <input type="text" placeholder="Password" value={userPassword} onChange={(e) => setUserPassword(e.target.value)} />
      <button onClick={handleLogin}>Login</button>
    </div>
  );
};

export default UserLogin;
